import React, { useState } from "react";
import axios from "axios";
import Header from "./Header";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";

function CreateFile() {
  const [name, setName] = useState("");
  const [cnpj, setCnpj] = useState("");
  const [tipoRemessa, setTipoRemessa] = useState("I");
  const [conta1, setConta1] = useState("");
  const [saldoDia1, setSaldoDia1] = useState("");
  const [conta2, setConta2] = useState("");
  const [saldoDia2, setSaldoDia2] = useState("");

  const contasDisponiveis = [
    { codigo: "3097000003", label: "Conta 1 (3097000003)" },
    { codigo: "4193000009", label: "Conta 2 (4193000009)" },
  ];

  const handleCreateFile = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem("token");

    const data = {
      name,
      cnpj,
      contas: [
        { codigoConta: conta1, saldoDia: saldoDia1 },
        { codigoConta: conta2, saldoDia: saldoDia2 },
      ],
      tipoRemessa,
    };

    try {
      await axios.post("http://localhost:8000/files.php", data, {
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "application/json",
        },
      });
      alert("Arquivo criado com sucesso!");
      window.location.href = "/files";
    } catch (error) {
      console.error("Erro ao criar arquivo:", error);
      alert("Erro ao criar arquivo. Tente novamente.");
    }
  };

  return (
    <div style={styles.container}>
      <Header />
      <h1 style={styles.title}>Lançamento 4111</h1>
      <form onSubmit={handleCreateFile} style={styles.form}>
        <div style={styles.formGroup}>
          <label style={styles.label}>Tipo de Remessa</label>
          <select
            value={tipoRemessa}
            onChange={(e) => setTipoRemessa(e.target.value)}
            style={styles.select}
            required
          >
            <option value="I">I (Primeira remessa do documento)</option>
            <option value="S">S (Substituir documento enviado e aceito)</option>
          </select>
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>Nome do Arquivo</label>
          <input
            type="text"
            placeholder="Nome do Arquivo"
            value={name}
            onChange={(e) => setName(e.target.value)}
            style={styles.input}
            required
          />
        </div>

        <div style={styles.formGroup}>
          <label style={styles.label}>CNPJ</label>
          <input
            type="text"
            placeholder="CNPJ"
            value={cnpj}
            onChange={(e) => setCnpj(e.target.value)}
            style={styles.input}
            required
          />
        </div>

        <h3 style={styles.subtitle}>Seleção de Contas</h3>

        <div style={styles.row}>
          <FormControl fullWidth variant="outlined" style={styles.selectBox}>
            <InputLabel>Conta</InputLabel>
            <Select
              value={conta1}
              onChange={(e) => setConta1(e.target.value)}
              label="Conta 1"
              required
            >
              {contasDisponiveis.map((conta) => (
                <MenuItem key={conta.codigo} value={conta.codigo}>
                  {conta.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <input
            type="number"
            placeholder="Saldo do Dia"
            value={saldoDia1}
            onChange={(e) => setSaldoDia1(e.target.value)}
            style={styles.inputInline}
            required
          />
        </div>

        <div style={styles.row}>
          <FormControl fullWidth variant="outlined" style={styles.selectBox}>
            <InputLabel>Conta</InputLabel>
            <Select
              value={conta2}
              onChange={(e) => setConta2(e.target.value)}
              label=""
              required
            >
              {contasDisponiveis.map((conta) => (
                <MenuItem key={conta.codigo} value={conta.codigo}>
                  {conta.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <input
            type="number"
            placeholder="Saldo do Dia"
            value={saldoDia2}
            onChange={(e) => setSaldoDia2(e.target.value)}
            style={styles.inputInline}
            required
          />
        </div>

        <button type="submit" style={styles.submitButton}>
          Criar
        </button>
      </form>
    </div>
  );
}

const styles = {
  container: {
    backgroundColor: "#32373C",
    color: "#FFFFFF",
    minHeight: "100vh",
    padding: "20px",
  },
  title: {
    textAlign: "center",
    marginBottom: "20px",
    fontSize: "2rem",
    color: "#FFFFFF",
  },
  form: {
    maxWidth: "600px",
    margin: "0 auto",
    backgroundColor: "#444B52",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
  },
  formGroup: {
    marginBottom: "15px",
  },
  label: {
    display: "block",
    marginBottom: "5px",
    color: "#FFFFFF",
  },
  input: {
    width: "100%",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #ddd",
    fontSize: "1rem",
  },
  inputInline: {
    width: "50%",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #ddd",
    fontSize: "1rem",
    marginLeft: "10px",
  },
  row: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: "15px",
  },
  select: {
    width: "100%",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #ddd",
    fontSize: "1rem",
    backgroundColor: "#FFFFFF",
    color: "#000000",
  },
  selectBox: {
    width: "50%",
  },
  subtitle: {
    marginTop: "20px",
    color: "#FFFFFF",
  },
  submitButton: {
    width: "100%",
    padding: "10px",
    backgroundColor: "#4CAF50",
    color: "#FFFFFF",
    border: "none",
    borderRadius: "5px",
    fontSize: "1rem",
    cursor: "pointer",
  },
};

export default CreateFile;
